import React, {Component} from 'react';
import Listavideos from './components/Listavideos';
import Form from './components/Form';
import Api from './api/Api.js'
import {Route} from 'react-router-dom';
import './App.css';


class App extends Component {
  constructor(props){
    super(props);
    this.state = {
          videos:[] ,
          selectedVideos: null,

    };
  }


  handleSubmit= async(termobusca) =>{
    const resposta= await Api.get('search', {
    params:{
      part:'snippet',
      maxResults:15,
      key:'AIzaSyCP8lufKgfTZ7tDE1gkRkaf4_DCyFXJ32o',
      q:termobusca
  }} );
    console.log(resposta)
    this.setState({videos: resposta.data.items, selectedVideos: resposta.data.items[0]});
    console.log(this.state.videos)

  }




  render(){
    return (
    <div >


            <Route  path='/'  render={(routeProps)=> 
              <Form {...routeProps} className="App" onFormSubmit={this.handleSubmit}/> , 
              <Listavideos {...routeProps} videos={this.state.videos}  /> } />








    </div>
  );

 }

}

export default App;
